import {CartItem} from "./CartItem";

export class Cart {
    items: CartItem[] = [];
    get totalPrice(): number{
        let totalPrice = 0;
        return totalPrice = this.items.reduce( totalPrice )
        this.items.forEach(item => totalPrice += item.price);
        return totalPrice;
    }
}
